import Trails from '../components/Trails'
import UserInput from '../components/UserInput';
import Link from 'next/link';

export default function Index() {
    console.log()
    return(
    <div>
        <Trails />
    </div>
    )
}

Index.getInitialProps = async function(props) {
    const res = await fetch(`https://www.hikingproject.com/data/get-trails-by-id?ids=7001635,7002742,7006663,7000108,7002175&key=200465360-942e3fb792b81fa531e25b7484cbc0f9`)
    const data = await res.json();
    return {
        trails: data.trails
    }
}
